import { Map as Maps, Marker } from "pigeon-maps";
import './Map.css';

class Map extends React.Component {
    render(){
        return(
            <Maps height={300} defaultCenter={[50.879, 4.6997]} defaultZoom={11}>
            <Marker width={50} anchor={[50.879, 4.6997]} />
          </Maps>
        );
    }
}

export default Map;
